import React from 'react';
import {
    Box,
    Table,
    TableBody,
    TableCell,
    TableContainer,
    TableHead,
    TableRow,
    Paper,
    Typography,
    IconButton,
    Tooltip,
    Link,
    TextField,
    CircularProgress,
    Collapse,
    Button
} from '@mui/material';
import { styled } from '@mui/material/styles';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import KeyboardArrowUpIcon from '@mui/icons-material/KeyboardArrowUp';
import InfoIcon from '@mui/icons-material/Info';
import FilterListIcon from '@mui/icons-material/FilterList';
import SearchIcon from '@mui/icons-material/Search';
import FilterBar from './FilterBar';

const StyledTableCell = styled(TableCell)(({ theme }) => ({
    '&.MuiTableCell-head': {
        backgroundColor: theme.palette.mode === 'dark' ? '#1e1e1e' : '#f5f5f5',
        fontWeight: 600
    }
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
    '&:hover': {
        backgroundColor: theme.palette.mode === 'dark' 
            ? 'rgba(255, 255, 255, 0.05)'
            : 'rgba(0, 0, 0, 0.02)'
    }
}));

const ExplanationButton = styled(IconButton)(({ theme }) => ({
    padding: 8,
    transition: 'all 0.2s'
}));

const ResultsTable = ({
    results,
    loadingExplanations,
    expandedExplanations,
    onGenerateExplanation,
    setExpandedExplanations,
    courseDescription
}) => {
    const [showFilters, setShowFilters] = React.useState(false);
    const [filters, setFilters] = React.useState({
        searchTerm: '',
        similarityRange: [0, 100],
        studyLevel: 'all',
        language: 'all',
        credits: 'all'
    });

    if (!results || !Array.isArray(results)) {
        return null;
    }

    const getFilteredResults = () => {
        return results.filter(course => {
            const searchMatch = !filters.searchTerm || 
                course.kurskode.toLowerCase().includes(filters.searchTerm.toLowerCase()) ||
                course.kursnavn.toLowerCase().includes(filters.searchTerm.toLowerCase());

            const similarityMatch = course.similarity >= filters.similarityRange[0] && 
                                  course.similarity <= filters.similarityRange[1];

            const levelMatch = filters.studyLevel === 'all' || 
                             course.level_of_study === filters.studyLevel;

            const languageMatch = filters.language === 'all' || 
                                course.undv_språk === filters.language;

            const creditsMatch = filters.credits === 'all' || 
                               course.credits === filters.credits;

            return searchMatch && similarityMatch && levelMatch && 
                   languageMatch && creditsMatch;
        });
    };

    const availableFilters = {
        studyLevels: [...new Set(results.filter(c => c.level_of_study).map(c => c.level_of_study))],
        languages: [...new Set(results.filter(c => c.undv_språk).map(c => c.undv_språk))],
        creditOptions: [...new Set(results.filter(c => c.credits).map(c => c.credits))]
    };

    const handleExplanationClick = (course) => {
        if (course.explanation) {
            setExpandedExplanations(prev => ({
                ...prev,
                [course.kurskode]: !prev[course.kurskode]
            }));
        } else {
            onGenerateExplanation(course, courseDescription);
        }
    };

    return (
        <>
            <Box sx={{ mb: 3 }}>
                <Box sx={{ display: 'flex', gap: 2, mb: 3 }}>
                    <TextField
                        size="small"
                        placeholder="Søk i resultater..."
                        value={filters.searchTerm}
                        onChange={(e) => setFilters(prev => ({ ...prev, searchTerm: e.target.value }))}
                        InputProps={{
                            startAdornment: <SearchIcon sx={{ mr: 1, color: 'text.secondary' }} />,
                            sx: { borderRadius: '12px' }
                        }}
                    />
                    <Button
                        variant="outlined"
                        startIcon={<FilterListIcon />}
                        onClick={() => setShowFilters(!showFilters)}
                        sx={{ borderRadius: '12px' }}
                    >
                        Filter
                    </Button>
                </Box>

                <Collapse in={showFilters}>
                    <FilterBar
                        filters={filters}
                        setFilters={setFilters}
                        availableFilters={availableFilters}
                    />
                </Collapse>
            </Box>

            <TableContainer component={Paper} variant="outlined">
                <Table>
                    <TableHead>
                        <TableRow>
                            <StyledTableCell>Kurs</StyledTableCell>
                            <StyledTableCell>Studiepoeng</StyledTableCell>
                            <StyledTableCell align="right">Likhet</StyledTableCell>
                            <StyledTableCell padding="checkbox" />
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {getFilteredResults().map((course) => (
                            <React.Fragment key={course.kurskode}>
                                <StyledTableRow>
                                    <StyledTableCell>
                                        <Link
                                            href={course.link_nb}
                                            target="_blank"
                                            rel="noopener noreferrer"
                                            sx={{ textDecoration: 'none' }}
                                        >
                                            <Typography variant="body2" sx={{ fontWeight: 500 }}>
                                                {course.kurskode}
                                            </Typography>
                                            <Typography variant="caption" color="text.secondary">
                                                {course.kursnavn}
                                            </Typography>
                                        </Link>
                                    </StyledTableCell>
                                    <StyledTableCell>{course.credits}</StyledTableCell>
                                    <StyledTableCell align="right">
                                        <Typography 
                                            variant="body2" 
                                            sx={{ 
                                                fontWeight: 600,
                                                color: theme => 
                                                    course.similarity >= 70 ? theme.palette.success.main :
                                                    course.similarity >= 50 ? theme.palette.warning.main :
                                                    theme.palette.error.main
                                            }}
                                        >
                                            {course.similarity}%
                                        </Typography>
                                    </StyledTableCell>
                                    <StyledTableCell padding="checkbox">
                                        <Tooltip title={course.explanation ? (expandedExplanations[course.kurskode] ? 'Skjul analyse' : 'Vis analyse') : 'Generer analyse'}>
                                            <ExplanationButton
                                                size="small"
                                                onClick={() => handleExplanationClick(course)}
                                                disabled={loadingExplanations[course.kurskode]}
                                            >
                                                {loadingExplanations[course.kurskode] ? (
                                                    <CircularProgress size={20} />
                                                ) : course.explanation ? (
                                                    expandedExplanations[course.kurskode] ? (
                                                        <KeyboardArrowUpIcon />
                                                    ) : (
                                                        <KeyboardArrowDownIcon />
                                                    )
                                                ) : (
                                                    <InfoIcon fontSize="small" />
                                                )}
                                            </ExplanationButton>
                                        </Tooltip>
                                    </StyledTableCell>
                                </StyledTableRow>
                                {course.explanation && expandedExplanations[course.kurskode] && (
                                    <TableRow>
                                        <TableCell colSpan={4} sx={{ p: 3, bgcolor: 'background.default' }}>
                                            {course.explanation.split('\n').map((line, index) => (
                                                <Typography
                                                    key={index}
                                                    variant="body2"
                                                    sx={{
                                                        mb: 1,
                                                        pl: line.startsWith('-') ? 2 : 0,
                                                        color: line.startsWith('#') ? 'primary.main' : 'text.primary',
                                                        fontWeight: line.startsWith('#') ? 600 : 400
                                                    }}
                                                >
                                                    {line}
                                                </Typography>
                                            ))}
                                        </TableCell>
                                    </TableRow>
                                )}
                            </React.Fragment>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
        </>
    );
};

export default ResultsTable;
